ise sur les données descriptives des taxons de la flore (référentiels taxonomiques, catalogues national et régionaux) ;</li><li>mutualiser les évaluations régionales pour permettre aux CBN d’avoir accès à une information à une échelle nationale (listes rouges régionales, listes régionales des espèces exotiques envahissantes). ;</li><li>réaliser une évaluation nationale des taxons de la flore (liste rouge, liste des espèces exotiques envahissantes).</li></ul><p><a href="https://www.youtube.com/watch?v=qM63nqkMUrg">Tutoriel vidéo n°1 - Utilisation général du site</a> (7min35)<br></p>', 0);
