INSERT INTO pres VALUES (3, 'home', 'public_header', 'Global public (début)', '<p align="center"><span style="font-size:24px;">Cet outil est réservé à l''usage interne du réseau des CBN.<br style="font-size: 24px;"><br style="font-size: 24px;">L''accès est contrôlé par un identifiant et un mot de passe délivrés par la FCBN.</span></p>', 0);
