INSERT INTO pres VALUES (12, 'lsi', 'header', 'Lettre Système Information (début)', '<hr><p align="center"><b><span style="font-size:18px;">Rubriques Système d''Information</span></b><br></p><p align="center">La LSI est une newletter mensuelle de veille technologique spécifique au domaine de la biodiversité. Cette rubrique permet de contribuer directement à la lettre en ajoutant et enrichissant des actualités. Elle permet également de revenir sur des actualités anciennes en utilisant les systèmes de filtre et classement des actualités.<br></p>', 0);
